  <footer>
    <div>
      Creado por <a href="https://www.facebook.com/profile.php?id=100007228694881">Cristian</a>
    </div>
    <div>
      <a href="https://www.facebook.com/profile.php?id=100007228694881">Sigueme en Facebook</a>
    </div>
  </footer>
);

